INSERT INTO `deposit_methods` (`id`, `name`, `how_to`, `json_data`, `thumb`, `method_identifier_field__name`, `created_at`, `updated_at`, `how_to_api`, `currency_id`, `status`, `detail`) VALUES
(1, '[ BTC ] - Bitcoin Wallet', '<p>Send the Bitcoin you wish to deposit to the adress below and let phpwallet support that you have made an Bitcoin deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\">bc1qxy2kgdygjrqtzq2n0yrf2493p83kkfjhx0wIh</h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', NULL, 'https://devv2.bitmetical.com//storage/imgs/ms5mlOOUXl8hoPK4MiduzFhwWfuKrsfcjhaEE0Rd.jpeg', 'Bitcoin adress', '2020-11-26 09:32:00', '2023-02-18 13:16:58', '<p>Send the Bitcoin you wish to deposit to the adress below and let phpwallet support that you have made a Bitcoin deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\"><strong>bc1qxy2kgdygjrqtzq2n0yrf2493p83kkfjhx0wIh</strong></h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', 6, 1, 'Send to our bitcoin wallet address'),
(2, '[ USD ] - Local Bank', '<p>Send the USD you wish to deposit to the Bank Accont below and let phpwallet support know that you have made a US Dollar deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\">23457564323 - Bank of Local Funding</h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', NULL, 'https://devv2.bitmetical.com//storage/imgs/UrMZeOypsVVM0qrqjR2m08vaYOVF1fDoaiSsy6Rx.png', 'Bank Account Number', '2020-11-26 09:37:00', '2023-02-18 13:14:34', '<p>Send the USD you wish to deposit to the Bank Accont below and let phpwallet support know that you have made a US Dollar deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\">23457564323 - Bank of Local Funding</h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', 1, 1, 'Send money to this account\r\nAccount name - phpwallet\r\nAccount number - 1234567890\r\nBank Name - Local Bank'),
(3, '[USDT] - USDT', '<p>Send the BRL you wish to deposit to the Bank Accont below and let phpwallet support know that you have made a Brazilian Real deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\">23457564323 - Bank of Local Funding</h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', NULL, 'https://devv2.bitmetical.com//storage/imgs/UrMZeOypsVVM0qrqjR2m08vaYOVF1fDoaiSsy6Rx.png', 'Bank Account Number', '2020-12-01 19:46:00', '2023-02-18 13:20:53', '<p>Send the BRL you wish to deposit to the Bank Accont below and let phpwallet support know that you have made a Brazilian Real deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\">23457564323 - Bank of Local Funding</h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', 13, 1, 'Send to our wallet address'),
(4, '[ KES ] - Local Bank', '<p>Send the EUR you wish to deposit to the Bank Accont below and let phpwallet support know that you have made a Euro deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\">23457564323 - Bank of Local Funding</h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', NULL, 'https://devv2.bitmetical.com//storage/imgs/UrMZeOypsVVM0qrqjR2m08vaYOVF1fDoaiSsy6Rx.png', 'Bank Account Number', '2020-12-01 19:47:00', '2023-02-18 13:12:43', '<p>Send the EUR you wish to deposit to the Bank Accont below and let phpwallet support know that you have made a Euro deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\">23457564323 - Bank of Local Funding</h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', 11, 1, 'Send to our bank account details'),
(5, '[ NGN ] - Local Bank', '<p>Send the Naira you wish to deposit to the Bank Accont below and let phpwallet support know that you have made a Nigerian Naira deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\">23457564323 - Bank of Local Funding</h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', NULL, 'https://devv2.bitmetical.com//storage/imgs/UrMZeOypsVVM0qrqjR2m08vaYOVF1fDoaiSsy6Rx.png', 'Bank Account Number', '2020-12-01 19:48:00', '2023-02-18 13:16:01', '<p>Send the Naira you wish to deposit to the Bank Accont below and let phpwallet support know that you have made a Nigerian Naira deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\">23457564323 - Bank of Local Funding</h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', 10, 1, 'Send to our bank'),
(6, '[ ETH ] -Ethereum Wallet', '<p>Send the Ethereum you wish to deposit to the adress below and let phpwallet support that you have made an Ethereum deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\">bc1qxy2kgdygjrqtzq2n0yrf2493p83kkfjhx0wIh</h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', NULL, 'https://devv2.bitmetical.com//storage/imgs/8IGnHbWSk8MGFn5Owk4v9c7gKa4TxMWWy2Oixl6E.png', 'Ethereum adress', '2020-12-01 19:50:00', '2023-02-18 13:12:04', '<p>Send the Ethereum you wish to deposit to the adress below and let phpwallet support that you have made an Ethereum deposit request via our WhatsApp or Telegram.</p>\r\n<p>&nbsp;</p>\r\n<h1 style=\"text-align: center;\">bc1qxy2kgdygjrqtzq2n0yrf2493p83kkfjhx0wIh</h1>\r\n<p>&nbsp;</p>\r\n<p>Your deposit request will be processed within 30 min.</p>', 7, 1, 'Send to our wallet address'),
