(36, 'escrows.percent_fee', 'Percent Fee', '1', NULL, 'text', 27, 'Escrows'),
(37, 'escrows.explainer_to_users', 'Explainer To Users', '<blockquote>\r\n<p style=\"box-sizing: inherit; font-family: Roboto, Helvetica, Arial, \'Microsoft Yahei\', 微软雅黑, STXihei, 华文细黑, sans-serif; margin: 0px 0px 2.4rem; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline; color: #4f5759;\">An escrow is a financial arrangement where a third party holds and regulates payment of the funds required for two parties involved in a given transaction. It helps make transactions more secure by keeping the payment in a secure escrow account which is only released when all of the terms of an agreement are met as overseen by the escrow company.</p>\r\n</blockquote>\r\n<p style=\"box-sizing: inherit; font-family: Roboto, Helvetica, Arial, \'Microsoft Yahei\', 微软雅黑, STXihei, 华文细黑, sans-serif; margin: 0px 0px 2.4rem; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline; color: #4f5759;\">&nbsp;</p>\r\n<ol style=\"box-sizing: inherit; font-family: Roboto, Helvetica, Arial, \'Microsoft Yahei\', 微软雅黑, STXihei, 华文细黑, sans-serif; margin: 0px 0px 2.4rem; padding: 0px 0px 0px 2.8rem; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: #4f5759;\" type=\"1\">\r\n<li style=\"box-sizing: inherit; font-family: inherit; margin: 0px; padding: 0px 0px 0px 0.8rem; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.75; vertical-align: baseline;\"><span style=\"box-sizing: inherit; font-family: inherit; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">Buyer and Seller agree to terms -</span>&nbsp;the Buyer begins a transaction. After creating an Escrow, all parties have agreed before to the terms of the transaction.</li>\r\n<li style=\"box-sizing: inherit; font-family: inherit; margin: 0px; padding: 0px 0px 0px 0.8rem; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.75; vertical-align: baseline;\"><span style=\"box-sizing: inherit; font-family: inherit; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">Buyer sends payment to seller -</span>&nbsp;The Buyer submits a payment by existing seller wallet account, we verifie the payment, the Seller is notified that funds have been secured \'In Escrow\'.</li>\r\n<li style=\"box-sizing: inherit; font-family: inherit; margin: 0px; padding: 0px 0px 0px 0.8rem; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.75; vertical-align: baseline;\"><span style=\"box-sizing: inherit; font-family: inherit; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">Seller ships merchandise to Buyer -</span>&nbsp;Upon payment verification, the Seller is authorised to send the merchandise and submit tracking information. we verifie that the Buyer receives the merchandise.</li>\r\n<li style=\"box-sizing: inherit; font-family: inherit; margin: 0px; padding: 0px 0px 0px 0.8rem; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.75; vertical-align: baseline;\"><span style=\"box-sizing: inherit; font-family: inherit; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">Buyer accepts merchandise -</span>&nbsp;The Buyer has a set number of days to inspect the merchandise and the option to accept or reject it. The Buyer accepts the merchandise</li>\r\n<li style=\"box-sizing: inherit; font-family: inherit; margin: 0px; padding: 0px 0px 0px 0.8rem; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.75; vertical-align: baseline;\"><span style=\"box-sizing: inherit; font-family: inherit; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;\">Buyer releases payment to seller -</span>&nbsp;we release the holded funds to the seller from the Escrow Account.</li>\r\n</ol>\r\n<p><strong>&nbsp;</strong></p>', NULL, 'rich_text_box', 29, 'Escrows'),
