INSERT INTO `transfer_methods` (`id`, `currency_id`, `name`, `accont_identifier_mechanism`, `how_to_deposit`, `how_to_withdraw`, `days_to_process_transfer`, `is_active`, `deleted_at`, `created_at`, `updated_at`, `deposit_percentage_fee`, `deposit_fixed_fee`, `withdraw_percentage_fee`, `withdraw_fixed_fee`, `thumbnail`, `merchant_fixed_fee`, `merchant_percentage_fee`, `mobile_thumbnail`, `is_hidden`, `is_system`) VALUES
(1, 11, '[ KENYA ] - MPESA', '[ KES ] - MPESA Mobile Number', '<p>To add credit into your kenian Shiling MPESA Wallet, Transfer&nbsp; the amount you wish to add&nbsp; to the MPESA number bellow and upload a picture or screenshot of your transfer with this form.</p>\r\n<p>&nbsp;+234&nbsp;234 57 56 43 23 - Lamb John Store</p>\r\n<p>&nbsp;Our Agents will be reviewing and adding credit to your wallet 24 hours after your uploaded receipts.</p>', '<p>&nbsp;Provide your [KES]&nbsp;<em>- Kenian Shiling</em>&nbsp;Bank Account number address bellow, and your withdrawal will be processed within a day.</p>', 1, 1, NULL, '2021-03-24 14:44:00', '2021-08-27 11:38:14', '2.00000000', '1.00000000', '0.00000000', '1.00000000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/mpesa-even.png', '0.00000000', '0.00000000', NULL, 0, 0),
(6, 1, 'RazorPay', 'RazorPay email', '<p>To add credit into your RazorPay Wallet you need to follow 3 steps.</p>\r\n<ol>\r\n<li>Go to&nbsp;https://razorpay.com/ and log into your account, then transfer the amount that you want to add in your RazorPay wallet here to the email transactions@phpwalletinc.com</li>\r\n<li>Come back to this website and upload a screenshot of your transfer receit&nbsp; in https://razorpay.com/&nbsp;in this form.</li>\r\n<li>wait for our agents to check your deposit request and release your funds in your razorpay wallet here. the reviewing process can take up to 24h.</li>\r\n</ol>', '<p>To take your money from your RazorPay Wallet you need to follow 3 steps.</p>\r\n<ol>\r\n<li>start a withdraw request using this form</li>\r\n<li>wait for our reviewers to confirm your request. the reviewing process can take up to 48h.</li>\r\n<li>check your money in https://razorpay.com/&nbsp;</li>\r\n</ol>', 2, 1, NULL, '2021-08-27 11:22:15', '2021-08-27 11:22:15', '5.00000000', '2.00000000', '5.00000000', '1.00000000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/razor-even.png', '0.00000000', '0.00000000', NULL, 0, 0),
(3, 1, 'Local Bank', 'Local Bank Account Number', '<p>Transfer the amount that you wish to deposit to the Local Bank account number below and upload the Local Bank deposit receipt</p>\r\n<p>&nbsp;Local Bank Account Number <strong>294367892.</strong></p>\r\n<p>After a successfull Bank transfer and receipt upload, our team of reviewers will process your deposit request and add credit to your wallet.</p>', '<p>Enter the withdraw amount and wait X days untill the amount reflects on your Local Bank acount.</p>', 1, 1, NULL, '2021-06-14 17:22:00', '2022-01-27 13:11:50', '0.00000000', '1.00000000', '0.00000000', '1.00000000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/localbank-odd.png', '0.00000000', '0.00000000', NULL, 0, 0),
(5, 1, 'PayTm', 'PayTm email', '<p>To add credit into your RazorPay Wallet you need to follow 3 steps.</p>\r\n<ol>\r\n<li>Go to&nbsp;https://paytm.com/ and log into your account, then transfer the amount that you want to add in your PayTm wallet here to the email transactions@phpwalletinc.com</li>\r\n<li>Come back to this website and upload a screenshot of your transfer receit&nbsp; in https://paytm.com/&nbsp;in this form.</li>\r\n<li>wait for our agents to check your deposit request and release your funds in your PayTm wallet here. the reviewing process can take up to 24h.</li>\r\n</ol>', '<p>To take your money from your PayTm Wallet you need to follow 3 steps.</p>\r\n<ol>\r\n<li>start a withdraw request using this form</li>\r\n<li>wait for our reviewers to confirm your request. the reviewing process can take up to 48h.</li>\r\n<li>check your money in https://paytm.com/</li>\r\n</ol>', 2, 1, NULL, '2021-08-27 11:27:08', '2021-08-27 11:27:08', '5.00000000', '1.00000000', '5.00000000', '1.00000000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/paytm-odd.png', '0.00000000', '0.00000000', NULL, 0, 0),
(7, 1, 'Stripe', 'Stripe email', '<p>To add credit into your Stripr Wallet you need to use click link</p>\r\n<p><span class=\"selectable-text copyable-text\"><a href=\"/en/buyvoucher/stripe\">CONTINUE</a></span></p>', NULL, 2, 0, NULL, '2021-08-27 11:40:00', '2023-02-05 18:54:29', '5.00000000', '1.00000000', '5.00000000', '1.00000000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/stripe-odd.png', '0.00000000', '0.00000000', NULL, 0, 0),
(28, 10, 'flutterwave', NULL, '<p>v</p>', '<p>v</p>', 1, 1, NULL, '2022-12-04 16:32:39', '2022-12-04 16:32:39', NULL, NULL, NULL, NULL, 'http://paytelex.com/assets/images/flutterwave.png', NULL, NULL, NULL, 0, 0),
(29, 1, 'UPI Payment', NULL, NULL, NULL, 1, 1, NULL, '2023-01-21 06:54:53', '2023-01-21 06:54:53', NULL, NULL, NULL, NULL, 'https://i.ibb.co/V2N8Jqh/upi-1674281887725.png', NULL, NULL, 'https://i.ibb.co/V2N8Jqh/upi-1674281887725.png', 0, 1),
(30, 10, 'India', 'UPI', '<p>UPI</p>', '<p>UPI</p>', 0, 1, NULL, '2023-01-21 11:07:34', '2023-01-21 11:07:34', '1.00000000', '1.00000000', '1.00000000', '1.00000000', NULL, '1.00000000', '1.00000000', NULL, 0, 0),
(31, 10, 'dev', 'dev', '<p>dev</p>', '<p>dev</p>', 1, 1, NULL, '2023-01-21 11:14:56', '2023-01-21 11:14:56', '1.00000000', '1.00000000', '1.00000000', '1.00000000', NULL, '1.00000000', '1.00000000', NULL, 0, 0),
(8, 1, 'PayPal', 'PayPal email', '<p>To add credit into your PayPal Wallet you need to follow 3 steps.</p>\r\n<ol>\r\n<li>Go to&nbsp;https://paypal.com/ and log into your account, then transfer the amount that you want to add in your PayPal wallet here to the email transactions@phpwalletinc.com</li>\r\n<li>Come back to this website and upload a screenshot of your transfer receit&nbsp; in https://paypal.com/&nbsp;in this form.</li>\r\n<li>wait for our agents to check your deposit request and release your funds in your payPal wallet here. the reviewing process can take up to 24h.</li>\r\n</ol>', '<p>To take your money from your PayPal Wallet you need to follow 3 steps.</p>\r\n<ol>\r\n<li>start a withdraw request using this form</li>\r\n<li>wait for our reviewers to confirm your request. the reviewing process can take up to 48h.</li>\r\n<li>check your money in https://paypal.com/</li>\r\n</ol>', 2, 1, NULL, '2021-08-27 11:44:04', '2021-08-27 11:44:04', '5.00000000', '1.00000000', '5.00000000', '1.00000000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/paypal-even.png', '0.00000000', '0.00000000', NULL, 0, 0),
(9, 11, '[ lesotho ] - MPESA', '[ M] - MPESA Mobile Number', '<p>To add credit into your Maloti MPESA Wallet, Transfer&nbsp; the amount you wish to add&nbsp; to the MPESA number bellow and upload a picture or screenshot of your transfer with this form.</p>\r\n<p>&nbsp;+234&nbsp;234 57 56 43 23 - Lamb John Store</p>\r\n<p>&nbsp;Our Agents will be reviewing and adding credit to your wallet 24 hours after your uploaded receipts.</p>', '<p>&nbsp;Provide your [M]&nbsp;<em>- Maloti</em>&nbsp;Bank Account number address bellow, and your withdrawal will be processed within a day.</p>', 1, 1, NULL, '2021-03-24 14:44:00', '2021-08-27 11:38:14', '2.00000000', '1.00000000', '0.00000000', '1.00000000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/mpesa-odd.png', '0.00000000', '0.00000000', NULL, 0, 0),
(10, 11, '[ Mozambique ] - MPESA', '[ MZN ] - MPESA Mobile Number', '<p>To add credit into your Metical MPESA Wallet, Transfer&nbsp; the amount you wish to add&nbsp; to the MPESA number bellow and upload a picture or screenshot of your transfer with this form.</p>\r\n<p>&nbsp;+234&nbsp;234 57 56 43 23 - Lamb John Store</p>\r\n<p>&nbsp;Our Agents will be reviewing and adding credit to your wallet 24 hours after your uploaded receipts.</p>', '<p>&nbsp;Provide your [MZN]&nbsp;<em>- Maloti</em>&nbsp;Bank Account number address bellow, and your withdrawal will be processed within a day.</p>', 1, 1, NULL, '2021-03-24 14:44:00', '2021-08-27 11:38:14', '2.00000000', '1.00000000', '0.00000000', '1.00000000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/mpesa-even.png', '0.00000000', '0.00000000', NULL, 0, 0),
(11, 11, '[ Egypt ] - MPESA', '[ EGP ] - MPESA Mobile Number', '<p>To add credit into your Egyptian pound MPESA Wallet, Transfer&nbsp; the amount you wish to add&nbsp; to the MPESA number bellow and upload a picture or screenshot of your transfer with this form.</p>\r\n<p>&nbsp;+234&nbsp;234 57 56 43 23 - Lamb John Store</p>\r\n<p>&nbsp;Our Agents will be reviewing and adding credit to your wallet 24 hours after your uploaded receipts.</p>', '<p>&nbsp;Provide your [EGP]&nbsp;<em>- Maloti</em>&nbsp;Bank Account number address bellow, and your withdrawal will be processed within a day.</p>', 1, 1, NULL, '2021-03-24 14:44:00', '2021-08-27 11:38:14', '2.00000000', '1.00000000', '0.00000000', '1.00000000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/mpesa-odd.png', '0.00000000', '0.00000000', NULL, 0, 0),
