(21, 7, 'Ethereum Network Adress', 'Ethereum Network Adress', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; line-height: 1.61em; color: #383d41; font-family: Poppins, Arial, Tahoma, sans-serif;\">Transfer the Eth amount to phpWallet inc Ethereum adress below and upload the transaction receipt.&nbsp;</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; line-height: 1.61em; color: #383d41; font-family: Poppins, Arial, Tahoma, sans-serif;\">After a successfull transfer and receipt upload, our team of reviewers will process your deposit request and add credit to your Eth wallet.</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; line-height: 1.61em; color: #383d41; font-family: Poppins, Arial, Tahoma, sans-serif;\">&nbsp;phpWallet inc Ethereum Adress :&nbsp;<strong><span style=\"color: #000000; font-family: \'Times New Roman\'; font-size: 16px; white-space: pre;\">1FfmbHfnpaZjKFvyi1okTjJJusN455paPH</span></strong></p>', '<p>Enter the Ethereum amount you wish to withdraw from your phpWallet and our withdraw team will send your Ethereum to the account address you have registered in your phpWallet Ethereum wallet account.</p>\r\n<p>it can take up to 2 days untill your withdraw request is succesfully processed.</p>', 2, 1, NULL, '2022-02-03 22:55:00', '2022-02-03 23:19:57', '1.00000000', '0.00030000', '1.00000000', '0.00030000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/rAo6IpXshwXaeCX9qO0EgT84kNXLjlebi7RMFkWk.png', '0.00030000', '1.00000000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/rAo6IpXshwXaeCX9qO0EgT84kNXLjlebi7RMFkWk.png', 0, 0),
(22, 12, 'Tron Network Adress', 'Tron Network Adress', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; line-height: 1.61em; color: #383d41; font-family: Poppins, Arial, Tahoma, sans-serif;\">Transfer the Shib amount to phpWallet inc Tron Network adress below and upload the transaction receipt.&nbsp;</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; line-height: 1.61em; color: #383d41; font-family: Poppins, Arial, Tahoma, sans-serif;\">After a successfull transfer and receipt upload, our team of reviewers will process your deposit request and add credit to your Shib wallet.</p>\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; line-height: 1.61em; color: #383d41; font-family: Poppins, Arial, Tahoma, sans-serif;\">&nbsp;phpWallet inc Tron Network Adress :&nbsp;<strong><span style=\"color: #000000; font-family: \'Times New Roman\'; font-size: 16px; white-space: pre;\">1FfmbHfnpaZjKFvyi1okTjJJusN455paPH</span></strong></p>', '<p>Enter the Shib amount you wish to withdraw from your phpWallet and our withdraw team will send your Shib to the account address you have registered in your phpWallet Shib wallet account.</p>\r\n<p>it can take up to 2 days untill your withdraw request is succesfully processed.</p>', 2, 1, NULL, '2022-02-03 22:55:00', '2022-02-03 23:21:18', '1.00000000', '0.00030000', '1.00000000', '0.00030000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/TUp04J6AB2kDeklKqYm1OGVWyLi5l29uORuWtbNo.png', '0.00030000', '1.00000000', 'https://devv2.dxtrader.xyz/storage/transfer-methods/TUp04J6AB2kDeklKqYm1OGVWyLi5l29uORuWtbNo.png', 0, 0),
